import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Dojo Blog</h1>
      <div className="links">
        <Link href="/">Home</Link>
        <Link href="/create" className="create-button">New Blog</Link>
      </div>
    </nav>
  );
}

export default Navbar;
